import{_ as e,o as t,c as a,O as r}from"./chunks/framework.9482e208.js";const g=JSON.parse('{"title":"§ 51.5-59 Annual report; Auditor of Public Accounts to audit books and accounts.","description":"","frontmatter":{},"headers":[],"relativePath":"vacode/51.5-59.md","filePath":"vacode/51.5-59.md"}'),o={name:"vacode/51.5-59.md"},n=r('<h1 id="§-51-5-59-annual-report-auditor-of-public-accounts-to-audit-books-and-accounts" tabindex="-1">§ 51.5-59 Annual report; Auditor of Public Accounts to audit books and accounts. <a class="header-anchor" href="#§-51-5-59-annual-report-auditor-of-public-accounts-to-audit-books-and-accounts" aria-label="Permalink to &quot;§ 51.5-59 Annual report; Auditor of Public Accounts to audit books and accounts.&quot;">​</a></h1><p>The Board shall submit an annual report that includes a statement of the receipts, disbursements, and current investments of the Fund for the preceding year to the Governor and the General Assembly. The report shall set forth a complete operating and financial statement covering the operation of the Fund during the year, including any loan fund or loan guarantee fund the Authority administers or manages. The Auditor of Public Accounts or his legally authorized representatives shall audit the books and accounts of the Authority and any loan fund or loan guarantee fund the Authority administers or manages as determined necessary by the Auditor of Public Accounts.</p><p>1995, c. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?951+ful+CHAP0812" target="_blank" rel="noreferrer">812</a>; 2006, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0344" target="_blank" rel="noreferrer">344</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?061+ful+CHAP0380" target="_blank" rel="noreferrer">380</a>; 2018, cc. <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0057" target="_blank" rel="noreferrer">57</a>, <a href="http://lis.virginia.gov/cgi-bin/legp604.exe?181+ful+CHAP0307" target="_blank" rel="noreferrer">307</a>.</p>',3),i=[n];function c(s,l,u,d,h,f){return t(),a("div",null,i)}const _=e(o,[["render",c]]);export{g as __pageData,_ as default};
